    public class Day1
    {
        public static int Main1(string[] args)
        {
            var list1 = new LocationList(List1);
            var list2 = new LocationList(List2);
            var dist = list1.Distance(list2);
            Console.WriteLine($"dist: {dist}");
            var similairty = list1.Similarity(list2);
            Console.WriteLine($"similarity: {similairty}");
            Console.ReadKey();
            return 0;
        }

        private class LocationList
        {
            public IList<int> locationIds;

            public LocationList(IList<int> locations)
            {
                this.locationIds = locations.OrderBy(id => id).ToList();
            }

            public int Distance(LocationList other)
            {
                if (this.locationIds.Count != other.locationIds.Count)
                {
                    throw new InvalidOperationException("different size list distances not defined!");
                }

                int dist = 0;
                for (int i = 0; i < this.locationIds.Count; ++i)
                {
                    if (this.locationIds[i] != other.locationIds[i])
                    {
                        dist += Math.Abs(this.locationIds[i] - other.locationIds[i]);
                    }
                }
                return dist;
            }

            public ulong Similarity(LocationList other)
            {
                var countRight = new Dictionary<int, int>(other.locationIds.Count);
                foreach (int num in other.locationIds)
                {
                    if (countRight.ContainsKey(num))
                    {
                        countRight[num] += 1;
                    }
                    else
                    {
                        countRight[num] = 1;
                    }
                }

                ulong score = 0;
                foreach (var num in this.locationIds)
                {
                    if (countRight.ContainsKey(num))
                    {
                        score += (ulong)(num * countRight[num]);
                    }
                }
                return score;
            }
        }

